import React from 'react';

export default () => {
  return (
    <table>
      <tbody>
        <tr>
          <th className={'green'}></th><th>{'- checked by mentor'}</th>
          <th className={'yellow'}></th><th>{'- students working on that task now'}</th>
          <th className={'gray'}></th><th>{'- task in todo state'}</th>
          <th className={'pink'}></th><th>{'- need to check'}</th>
          <th className={'red'}></th><th>{'- checked by mentime for checking is gone and no mark from mentor'}</th>
        </tr>
      </tbody>
    </table>
  );
};
